DECLARE @DATA TABLE (BF_SSN CHAR(9))
	

select * from @DATA


SELECT DISTINCT
	D.BF_SSN,
	F.LC_FOR_TYP,
	F.LD_FOR_BEG,
	F.LD_FOR_END
FROM 
	@DATA D
	LEFT JOIN
	(
		SELECT	
			FB10.*,
			LN50.LD_FOR_BEG, 
			LN50.LD_FOR_END,
			LN50.LC_STA_LON60,
			LN50.LC_FOR_RSP
		FROM
			CDW..FB10_BR_FOR_REQ FB10
			INNER JOIN CDW..LN60_BR_FOR_APV LN50
				ON LN50.BF_SSN = FB10.BF_SSN
				AND LN50.LF_FOR_CTL_NUM = FB10.LF_FOR_CTL_NUM
		WHERE
			'07/31/2020' BETWEEN LD_FOR_BEG AND LD_FOR_END
			and fb10.LC_FOR_STA = 'a'
			and fb10.LC_STA_FOR10 = 'a'
			and ln50.LC_STA_LON60 = 'a'

	) F
		ON F.BF_SSN = D.BF_SSN
ORDER BY 
	D.BF_SSN
